import Header from "./Components/Main/Header/Header.jsx";

import Nav from "./Components/Main/Nav/Nav.jsx";
import NavOne from "./Components/Main/Nav/NavOne.jsx";
import AuthenticationContainer from "./Components/Authentication/AuthenticationContainer.jsx";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
//import { Provider } from "react";
import { Provider } from "react-redux";
function App() {
  return (
    <div className="container">
      <Provider>
        <Router>
          <Header />
          <Route path="/Auth" render={() => <AuthenticationContainer />} />
          <Nav />
          <NavOne />
        </Router>
      </Provider>
    </div>
  );
}

export default App;
